(11, 'Trang Chủ', 'trang-chu', 'trang-chu-1597420914.png', 1, '<p>Trang Chủ&nbsp;<span style=\"background-color: rgb(255, 255, 255); font-size: 1rem; color: rgb(51, 72, 98); transition: all 0.3s ease 0s; font-family: &quot;Open Sans Condensed&quot;, sans-serif; touch-action: manipulation; font-weight: bolder;\">CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN</span></p>', 'Trang Chủ CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN, chuyên cho thuê xe tải 5 tấn, 2,5 tấn, 1 tấn, 1,5 tấn', 'Trang Chủ CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN, chuyên cho thuê xe tải 5 tấn, 2,5 tấn, 1 tấn, 1,5 tấn', '2020-04-09 16:49:30', '2020-08-14 16:01:54', NULL),
(24, 'Liên Hệ', 'lien-he', 'lien-he-1597420452.jpg', 0, '<p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\"><span style=\"text-decoration-line: underline; font-size: 18.4px;\"><span style=\"font-weight: bolder;\">Liên hệ làm việc với Công ty</span></span></p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\"><span style=\"font-weight: bolder;\">CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN</span></p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\">Mã số thuế: 3702630576</p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\">Địa chỉ: Thửa đất số 2113, Tờ bản đồ số 06 – 8, Khu 8, Phường Phú Mỹ, Thành phố Thủ Dầu Một, Tỉnh Bình Dương</p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\">Hotline: 0933 444 776 – Mr Mộng</p>', 'CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN Mã số thuế: 3702630576 Địa chỉ: Thửa đất số 2113, Tờ bản đồ số 06 – 8, Khu 8, Phường Phú Mỹ, Thành phố Thủ Dầu Một, Tỉnh Bình Dương', 'CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN Mã số thuế: 3702630576 Địa chỉ: Thửa đất số 2113, Tờ bản đồ số 06 – 8, Khu 8, Phường Phú Mỹ, Thành phố Thủ Dầu Một, Tỉnh Bình Dương', '2020-04-10 04:06:51', '2020-08-14 15:54:12', NULL),
(25, 'Giới Thiệu', 'gioi-thieu', 'gioi-thieu-1597420199.jpg', 0, '<p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\"><a href=\"https://khanhan.info/\" style=\"touch-action: manipulation; color: rgb(51, 72, 98);\"><span style=\"font-weight: bolder;\">CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN</span></a></p><h2 style=\"color: rgb(85, 85, 85); width: 1050px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 1.6em; line-height: 1.3; font-family: &quot;Fira Sans&quot;, sans-serif; font-weight: 700;\">Các dịch vụ chúng tôi cung cấp</h2><ol style=\"list-style-position: initial; list-style-image: initial; padding: 0px; margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\"><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\"><em><span style=\"font-weight: bolder;\">Vận tải đường bộ nội địa – vận chuyển hàng hóa</span></em></li><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\"><em><span style=\"font-weight: bolder;\">Cho thuê xe du lịch</span></em></li><li style=\"margin-bottom: 0.6em; margin-left: 1.3em;\"><em><span style=\"font-weight: bolder;\">Dịch vu thuê cho thuê xe 4 &gt; 30 chỗ</span></em></li></ol><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\">Manh nha phát triển từ những năm 2015, đến đầu tháng 8/2018 với yêu cầu từ khách hàng cũng như sự phát triển của xã hội, và cũng để phát triển to lớn hơn thì CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN ra đời với mục đích xây dựng thương hiệu Khánh An không chỉ lớn mạnh tại khu vực TP Thủ Dầu Một, Bến Cát mà toàn bộ khu vực Bình Dương rộng lớn</p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\"><span style=\"font-weight: bolder;\">Lợi thế:</span></p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\">– Có thể huy động nhiều xe phục vụ hoạt động cùng một lúc<br>– Đội ngũ tài xế giỏi trong lĩnh vực vận tải, am hiểu hàng hóa vận chuyển, thành thuộc tuyến đường vận chuyển<br>– Đội ngũ điều hành linh hoạt, có thể giải quyết nhu cầu vận chuyển gấp đối với khách hàng</p><h3 style=\"color: rgb(85, 85, 85); width: 1050px; margin-bottom: 0.5em; text-rendering: optimizespeed; font-size: 1.25em; font-family: &quot;Fira Sans&quot;, sans-serif; font-weight: 700;\"><em><span style=\"font-weight: bolder;\"><span style=\"font-family: Tahoma;\">Liên hệ làm việc với&nbsp;</span><a href=\"https://khanhan.info/\" style=\"touch-action: manipulation; color: rgb(51, 72, 98);\"><span style=\"font-family: Tahoma;\">Khánh An</span></a></span></em></h3><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\">Địa chỉ: Thửa đất số 2113, Tờ bản đồ số 06 – 8, Khu 8, Phường Phú Mỹ, Thành phố Thủ Dầu Một, Tỉnh Bình Dương</p><p style=\"margin-bottom: 1.3em; color: rgb(119, 119, 119); font-family: &quot;Open Sans Condensed&quot;, sans-serif;\"><span style=\"font-weight: bolder;\">Hotline: 0933 444 667 – Mr Mộng – Director</span></p>', 'Giới Thiệu CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN Các dịch vụ chúng tôi cung cấp  Vận tải đường bộ nội địa', 'Giới Thiệu CÔNG TY TNHH MTV DỊCH VỤ VẬN TẢI KHÁNH AN Các dịch vụ chúng tôi cung cấp  Vận tải đường bộ nội địa', '2020-07-25 16:56:50', '2020-08-14 15:49:59', NULL);

